import React, { useState } from 'react';
import './usuario-recuperar-senha.css';
import { link } from 'react-router-dom';
import Navbar from '../../components/navbar'

import firebase from '../../config/firebase';
import 'firebase/auth'

function UsuarioRecuperarSenha() {
  return (
    <>
      <Navbar />
      <div className='form-cadastro'>
        <form className='text-center form-login mx-auto mt-5'>
          <h1>Recuperar Senha</h1>
          <input type='email' className='form-control my-2' placeholder=' Coloque seu Email' />
          <div className='msg my-4'>
            <span></span>
          </div>
          <button type='button' className='btn btn-lg btn-enviar'>Recuperar Senha</button>
        </form>

      </div>
    </>
  )
}
export default UsuarioRecuperarSenha;
